const funcs = [
  { name: 'click', args: [] },
  { name: 'setVisibility', flow: ['false', 'true'] }
];

function wait(ms) {
  return new Promise(resolve => setTimeout(resolve, ms));
}

async function runValid() {
  for (let i = 0; i < funcs.length; i++) {
    const { name, flow, args = [] } = funcs[i];
    if (typeof components.actionsIcon[name] === 'function') {

      if (flow) {
        for (let j = 0; j < flow.length; j++) {
          const val = flow[j] === 'true';
          try {
            await components.actionsIcon[name](val);
            actions.showAlert('success', ` Valid: ${name}(${val})`);
          } catch (e) {
            actions.showAlert('error', ` Error calling valid ${name}(${val}): ${e.message || e}`);
          }
          await wait(2000);
        }
      } else {
        try {
          await components.actionsIcon[name](...(args || []));
          actions.showAlert('success', ` Valid: ${name}()`);
        } catch (e) {
          actions.showAlert('error', ` Error calling valid ${name}: ${e.message || e}`);
        }
        await wait(2000);
      }

    }
  }
  return " All valid tests done for actionsIcon!";
}

return runValid();

